function mergeHeaders(baseHeaders, customHeaders) {
    return [...Object.entries(customHeaders ?? {}), ...Object.entries(baseHeaders ?? {})]
        .reduce((output, [key, value]) => {
            if (!Object.hasOwn(output, key.toLowerCase())) output[key.toLowerCase()] = value;
            return output;
        }, {});
}

