function getArgumentFields(json) {

    if (!json) return;

    try {
        json = JSON.parse(json);
    } catch (error) {
        return;
    }

    let arr = [];
    json.forEach(item => {
        let obj = {
            name: item.name,
            label: item.name,
            required: item.required
        };

        let type = item.type.split(', ')[0]

        switch (type) {
            case 'System.Int32':
                obj.type = 'number';
                break;
            case 'System.Int32[]':
                obj.type = 'array';
                obj.spec = {
                    type: 'number'
                }
                break;
            case 'System.Boolean':
                obj.type = 'boolean';
                break;
            case 'System.DateTime':
                obj.type = 'date';
                break;
            case 'System.String':
                obj.type = 'text';
                break;
            case 'System.String[]':
                obj.type = 'array';
                obj.spec = {
                    type: 'text'
                }
                break;
            case 'System.Object':
                obj.type = 'json';
                break;

            default:
                return;
        }

        arr.push(obj);
    });

    return arr.length === 0 ? undefined : {
        name: 'inputArguments',
        label: 'Input Arguments',
        type: 'collection',
        spec: arr,
		advanced: true
    }

}

